REG ADD "HKLM\SOFTWARE\WOW6432Node\ORL\WinVNC3\Default" /v "AutoPortSelect" /t REG_DWORD /d 1 /f 2>&1> $null
REG ADD "HKLM\SOFTWARE\WOW6432Node\ORL\WinVNC3\Default" /v "InputsEnabled" /t REG_DWORD /d 1 /f 2>&1> $null
